      SELECT col1 * + col1 * col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - col1 * - 25 / + CAST ( + + 87 AS REAL ) ) IN ( - 46, ( CAST ( NULL AS INTEGER ) ) );
  - name: tab0

outputs:
  - name: q1914.out
    data: |
